INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (0, 100911, 1, 10, 16612, 0.5, "ふふ、やった！　やったぞ！\nまたしても傑作の完成だ！\nみんなの努力が実る、この瞬間……\n何度やっても達成感があるな！", 1, 16612026, 0, 11);
