INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (0, 103011, 1, 10, 19812, 0.5, "シュバババババ～♪\n忍法に不可能はありまセン！\nウキヨエを壁に描くのも\nお手の物デス！", 1, 19812029, 0, 11);
