INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (0, 105311, 1, 10, 19812, 0.5, "いや、浮世絵って\nこんな感じだったか？\nオーエドで見たのは、もう少し\n違う雰囲気だった気がするのだが。", 1, 19812034, 0, 11);
