INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (0, 100811, 1, 10, 19812, 0.5, "美を伝えるという点では同じだよ。\nボクだって歯磨きをするボクや\nお昼ご飯を食べるボクがいるけど、\n全て美しいボクには違いないでしょ？", 1, 19812039, 0, 11);
