INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (0, 103011, 1, 10, 23812, 0.5, "オー、まさに陰と陽！\nこれがゲージュツの分野で\nいうところの、コントラストと\nいうヤツなのでショウか？", 1, 23812036, 0, 11);
