INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (0, 104911, 1, 10, 25212, 0.5, "よし、なかなか上手く描けたよ。\nでも、弟くんへの愛を表すには\nまだちょっと足りなかったかなあ？", 1, 25212018, 0, 11);
