INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (0, 101111, 1, 10, 25212, 0.5, "そういうのは今はいいですから！\nでもお姉ちゃん美人で頭良くて強いのに\n絵までうまいんですねえ……\nまさに文句上等？　ってやつですよ。", 1, 25212023, 0, 11);
