INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (0, 103211, 1, 10, 39512, 0.5, "どれどれ……問題ありませんわ。\nただ、麦しゅわはちゃんと量を\n考えてたしなむべきです。\nそのうち体を壊しますわよ？", 1, 39512027, 0, 11);
